import React from 'react';
import './CultureSelector.css';

// Placeholder imports - replace these with actual image paths
import portugueseFlag from './img/portugualFlag.png';
import brazilianFlag from './img/brazilFlag.png';
import indianFlag from './images/indiaFlag.png';
import chineseFlag from './images/chinaFlag.png';

function CultureSelector() {
  // You would typically fetch these from a server
  const cultures = [
    { name: 'Portuguese', flag: portugueseFlag },
    { name: 'Brazilian', flag: brazilianFlag },
    { name: 'Indian', flag: indianFlag },
    { name: 'Chinese', flag: chineseFlag },
  ];

  return (
    <div className="CultureSelector">
      <h2>Popular Cultures</h2>
      <div>
        {cultures.map(culture => (
          <button key={culture.name}>
            <img src={culture.flag} alt={`${culture.name} flag`} />
            {culture.name}
          </button>
        ))}
      </div>
    </div>
  );
}

export default CultureSelector;
